// TODO: create a form for initiative creation
import {Button, Grid, MenuItem, Typography} from "@mui/material";
import React, {useState} from "react";
import {CssTextField} from "../Utils/CustomTextFields";
import Chip from '@mui/material/Chip';
import Person2Icon from '@mui/icons-material/Person2';
import 'date-fns';
import DateFnsUtils from '@date-io/date-fns';
import {
    MuiPickersUtilsProvider,
    KeyboardTimePicker,
    KeyboardDatePicker,
} from '@mui/pickers';

const CreateInitiativesForm = () => {
    const types = ['Beneficenza', 'Sociale', 'Privato', 'Urbanistico', 'Svago']
    const [allUsers, setAllUsers] = useState(['utente1', 'utente2', 'utente3', 'utente4', 'utente5', 'utente6', 'utente7', 'utente8', 'utente9', 'utente10', 'utente11'])
    const [organizers, setOrganizers] = useState<any>([])

    const addOrganizer = (user: any) => {
        setOrganizers([...organizers, user])
    }
    const handleDelete = (user: any) => {
        const new_organizers = organizers.filter((old_user: any) => old_user !== user)
        setOrganizers(new_organizers)
    }
    const handleCreateInitiative = () => {
        console.log('CREA')
    }

    const [selectedDate, setSelectedDate] = React.useState<Date | null>(
        new Date('2014-08-18T21:11:54'),
    );

    const handleDateChange = (date: Date | null) => {
        setSelectedDate(date);
    };

    return (
        <>
            <Grid container direction="column" spacing={2}>
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center" sx={{
                    width: '100%',
                    position: 'fixed',
                    margin: "auto",
                    top: 65,
                    right: 0
                }}>
                    <Typography
                        style={{color: '#feac0d', textAlign: 'center', fontSize: '3rem'}}>Crea la tua
                        iniziativa</Typography>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <CssTextField sx={{width: '60%', input: {color: 'white'}, style: {color: 'white'}}}
                                  id="standard-basic" label="Nome" variant="standard"/>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <CssTextField sx={{width: '60%', input: {color: 'white'}, style: {color: 'white'}}}
                                  id="standard-basic" label="Descrizione" variant="standard"/>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <CssTextField
                        sx={{width: '60%', color: 'white', input: {color: 'white'}, style: {color: 'white'}}}
                        id="outlined-select-currency"
                        select
                        label="Tipologia"
                        defaultValue={types[0]}
                    >
                        {types.map((value, index) => (
                            <MenuItem key={value} value={value}>
                                {value}
                            </MenuItem>
                        ))}
                    </CssTextField>
                </Grid>

                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    {
                        organizers.map((value: string) => {
                            return (
                                <Chip
                                    avatar={<Person2Icon style={{color: '#feac0d'}}/>}
                                    sx={{color: 'white', marginLeft: '10px'}}
                                    label={value}
                                    onDelete={() => {
                                        handleDelete(value)
                                    }}
                                />
                            )
                        })
                    }
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <CssTextField
                        sx={{width: '60%', color: 'white', input: {color: 'white'}, style: {color: 'white'}}}
                        id="outlined-select-currency"
                        select
                        label="Aggiungi organizzatore"
                    >
                        {allUsers.map((value, index) => (
                            <MenuItem key={value} value={value} onClick={() => {
                                addOrganizer(value)
                            }}>
                                {value}
                            </MenuItem>
                        ))}
                    </CssTextField>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <CssTextField sx={{width: '60%', input: {color: 'white'}, style: {color: 'white'}}}
                                  id="standard-basic" label="Luogo" variant="standard"/>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent='center' alignItems='center'>
                    <Button style={{
                        marginTop: '15px',
                        borderRadius: 35,
                        backgroundColor: "#92d36e",
                        padding: "10px 20px",
                        fontSize: "18px"
                    }}
                            variant="contained"
                            onClick={() => {
                                handleCreateInitiative()
                            }}>
                        CREA
                    </Button>
                </Grid>
                <MuiPickersUtilsProvider utils={DateFnsUtils}>
                    <Grid container justifyContent="space-around">
                        <KeyboardDatePicker
                            disableToolbar
                            variant="inline"
                            format="MM/dd/yyyy"
                            margin="normal"
                            id="date-picker-inline"
                            label="Date picker inline"
                            value={selectedDate}
                            onChange={handleDateChange}
                            KeyboardButtonProps={{
                                'aria-label': 'change date',
                            }}
                        />
                        <KeyboardDatePicker
                            margin="normal"
                            id="date-picker-dialog"
                            label="Date picker dialog"
                            format="MM/dd/yyyy"
                            value={selectedDate}
                            onChange={handleDateChange}
                            KeyboardButtonProps={{
                                'aria-label': 'change date',
                            }}
                        />
                        <KeyboardTimePicker
                            margin="normal"
                            id="time-picker"
                            label="Time picker"
                            value={selectedDate}
                            onChange={handleDateChange}
                            KeyboardButtonProps={{
                                'aria-label': 'change time',
                            }}
                        />
                    </Grid>
                </MuiPickersUtilsProvider>
            </Grid>
        </>
    )
}

export default CreateInitiativesForm
